(25, 'Kosan Waskita', 'Gg. Lada No. 49, Magelang 18820, Kepri', 'Lampung Timur', 'Praesentium molestiae ut exercitationem repudiandae atque maiores laudantium eius veritatis beatae sit rerum et animi assumenda aliquid unde velit voluptatem modi veniam ut eum veritatis nobis ducimus ullam earum nostrum sit aut explicabo sed iste laudantium nihil fugit quis hic ducimus quam quidem optio tenetur aut id natus culpa voluptatem veritatis sunt qui nulla odit dolorem perferendis et doloremque ullam voluptatibus non repudiandae eaque aut nobis ab perferendis sapiente omnis quis accusantium eos est ipsam qui libero provident et et asperiores consectetur alias harum eligendi sit quo recusandae mollitia et.', 'Qui vero et beatae sapiente dicta sed est quis dolorem rerum rerum distinctio perspiciatis repellendus maxime et quis omnis praesentium commodi consequatur et consequatur ut temporibus illum quo rerum hic debitis sed libero alias laudantium explicabo quisquam rerum et at et tempora natus eligendi voluptatibus qui est cumque culpa quos voluptas pariatur nihil saepe hic illo blanditiis laborum ut pariatur blanditiis magnam tempora voluptatem et est quia minus hic rerum qui illo distinctio ipsa omnis deserunt necessitatibus ea molestiae sit perspiciatis aliquid expedita omnis modi consequatur necessitatibus pariatur autem quisquam et sequi tenetur voluptas quis et reprehenderit natus et asperiores porro libero voluptas quia sed temporibus molestiae nemo commodi ut soluta sunt deleniti debitis est dolorum omnis atque illum qui quas est praesentium est sequi voluptates quia sit recusandae enim et omnis dolor vel sit praesentium eveniet.', 659316, 'Putra', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(26, 'Kosan Puspita', 'Kpg. Supomo No. 813, Pagar Alam 37904, Maluku', 'Lampung Timur', 'Nihil sed facilis voluptatum neque repellat et maxime quam dolor numquam labore perspiciatis aut rerum commodi ut repudiandae ipsa illo maiores necessitatibus quis tempora ex dolorem dolores aliquid distinctio ut numquam aut commodi omnis in perspiciatis nostrum aliquid nesciunt officia cum porro rem est cumque impedit quo optio eligendi similique dolorem illum non saepe consequatur numquam blanditiis ut quae dolor et exercitationem et eveniet quo sequi veniam et quam reiciendis dolore voluptas ullam placeat nostrum sed veniam vitae ut quia ipsa animi dolorum ut eum doloremque facilis sit labore facere nulla ipsum quia possimus aut facere illum ipsam autem fugiat corrupti nobis natus aut quos incidunt quia enim laboriosam non asperiores hic.', 'Optio nihil itaque fugiat excepturi deserunt deleniti animi aut sed explicabo praesentium ducimus unde eos in molestias tenetur aperiam aspernatur eius dolor reprehenderit enim quis dolorem rerum esse rem velit ab error labore et iusto repudiandae dolorum accusantium quas minima voluptas et ut voluptatem illum quidem sunt debitis quia qui non in quod quo eos quia cupiditate culpa sint minima molestiae nostrum et aut similique cupiditate soluta laudantium omnis placeat qui eos voluptatibus velit voluptatem iusto tempore architecto illum et a sint sed dolores ullam ut ut ratione illum vel et aut iusto quia dolore et vero quos totam et doloremque rerum in aut cumque veniam neque cupiditate in incidunt vel est aut qui eius odio asperiores quo alias unde.', 817265, 'Putri', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(27, 'Kosan Yuniar', 'Gg. Cut Nyak Dien No. 28, Cilegon 68639, DKI', 'Metro', 'Inventore non qui quo nihil sit est fuga quia veniam fugiat quibusdam unde vel illo dignissimos repudiandae porro beatae qui commodi voluptates atque doloribus voluptates minima et laboriosam debitis est voluptatem at enim dolorum necessitatibus quam autem deleniti dicta repellendus tenetur at eum nisi asperiores consequatur debitis in est commodi cumque quia voluptatum iste nihil dolorem qui debitis et omnis fugit quia eum iure rerum et eius tempora enim dolores culpa quidem fugiat est mollitia recusandae quam earum quasi autem qui quos perspiciatis quia qui quae sit eos atque tempore ab molestias voluptatem adipisci aut sit fuga odit natus aut quaerat natus repellat earum veritatis voluptas laborum cumque expedita labore et temporibus nobis ipsum cum.', 'Odio voluptatem tempore corporis at eaque fuga officiis rerum pariatur nihil error fuga eligendi velit totam voluptatem ex expedita sit quia eos possimus expedita laborum optio nihil est rerum exercitationem quis placeat repudiandae similique natus fuga nisi eaque harum aspernatur ut perferendis dignissimos ut molestiae eum dolor et assumenda qui rerum sed voluptas qui voluptatibus non vero quas voluptas et occaecati incidunt sint ipsam deleniti laborum est dicta laudantium quis exercitationem veniam voluptas in ad quo sint cumque distinctio aut sed rem commodi totam vel sunt quibusdam.', 745934, 'Campur', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(28, 'Kosan Prasetyo', 'Ki. Fajar No. 387, Sabang 80551, Papua', 'Lampung Utara', 'Et consectetur sint vel aliquam molestiae qui repellat atque sed aspernatur quaerat et doloremque voluptatem similique magnam repudiandae sed molestias praesentium voluptates dolores voluptatem dolor fuga quia impedit maxime perferendis quia cum et deleniti unde odio nemo temporibus ea voluptatem illum recusandae quis nihil rerum aliquam qui quis saepe tenetur accusantium possimus suscipit quae iste est iste non eum minima ad reiciendis.', 'Saepe vel et et ad ea dolor natus debitis sunt voluptas et atque doloremque non consequatur reiciendis rem autem quis omnis earum dolor porro est vitae beatae modi magni perspiciatis et iure dolorem voluptatem laudantium nihil impedit adipisci deserunt sapiente libero quaerat alias quo deleniti optio nemo in totam quam magni iure ex iure ducimus saepe et quae dolore incidunt illum ut deserunt amet voluptate quo dolorem eligendi tenetur dolorem perspiciatis autem ut reprehenderit eligendi vel quos consequatur omnis voluptas minus minima ut quo voluptatem et qui accusamus et voluptatum rerum est quaerat minima iure sed repellendus blanditiis modi inventore quis eum.', 638819, 'Putri', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(29, 'Kosan Utami', 'Ki. Ujung No. 91, Lhokseumawe 91100, Sumbar', 'Lampung Selatan', 'Ducimus deserunt eius ut impedit in ut quos maiores libero voluptates adipisci eum laborum sit esse culpa velit laboriosam voluptates et maiores ex animi cupiditate maiores adipisci nulla modi omnis quis consequatur culpa quis repellendus modi sed quos aut temporibus illo ut et dolore qui quasi sit odit sapiente voluptas voluptates repellat consectetur repellendus optio quis voluptas sunt sit ab consequatur architecto explicabo.', 'Ut et in totam doloremque sed aut vero et ex et quia unde et amet quidem est voluptatibus error et non ut praesentium ipsa numquam dolores est et nostrum voluptas qui voluptatem aut omnis est dignissimos necessitatibus veritatis pariatur quis est ipsum qui ex et quod repellendus dolore facilis vel rerum rem veniam quasi repellat itaque est rerum aut est laborum voluptatum alias et incidunt laudantium vero et fugiat quae repellendus sit est quidem dolores voluptas quam et dolorem enim exercitationem dolor beatae reprehenderit optio error similique quae labore sed at est ex aliquid cumque quos blanditiis quas incidunt eveniet fugiat est ipsum veniam illum.', 902128, 'Campur', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(30, 'Kosan Mulyani', 'Gg. Bakti No. 877, Administrasi Jakarta Barat 53965, Bali', 'Lampung Tengah', 'Nostrum aut velit voluptatem distinctio dolor voluptatum harum illo veniam modi possimus ratione rem quidem autem harum libero consequatur reprehenderit corrupti voluptate porro perferendis aut sed asperiores culpa eaque ducimus ratione est ratione mollitia pariatur et et debitis sequi esse aut molestiae modi aliquid dolor aut doloribus ut impedit ratione perferendis voluptatibus sed et quo odit ut repellat aut et eum nisi dolore facilis qui eligendi minus minima minus suscipit vel quasi odio nulla voluptas ut odit quod porro qui temporibus eius praesentium quas magnam eligendi nostrum tenetur totam.', 'Dolorum est rerum enim voluptas temporibus consectetur porro quo nemo rem sed et velit vitae deserunt voluptatem voluptas cum natus et cum aperiam incidunt architecto sit rerum et nobis non voluptatem magni inventore nulla numquam dicta libero qui quasi expedita deserunt qui assumenda est voluptas minima quis architecto laborum incidunt laborum qui esse sit ipsum totam molestiae voluptates reiciendis error assumenda voluptas blanditiis pariatur numquam eius nesciunt omnis voluptatem est corrupti rem sint quo veniam nisi enim voluptatem et mollitia dolorem voluptas iure quo dolorem in quia numquam quia eum minima repudiandae corporis consequatur quia nisi numquam laudantium reprehenderit nisi dolorem nihil eum id culpa necessitatibus quos porro possimus ut laboriosam nam aut dicta molestiae.', 677602, 'Putra', 1, '2022-10-30 22:31:57', '2022-10-30 22:31:57', '2022-10-30 22:31:57'),
(31, 'Kosan Prabowo', 'Ds. Baiduri No. 566, Solok 56551, NTB', 'Lampung Utara', 'Consequuntur molestiae ex labore nobis delectus praesentium facilis reiciendis occaecati incidunt soluta ut quo eaque explicabo expedita doloremque aut dolorum repellat qui in architecto non neque rerum odit consequuntur eveniet ducimus officiis quas ratione quo sequi est saepe dicta aut aliquam dolore aut eaque quis deleniti pariatur tenetur reprehenderit non itaque qui facere officia dolor quibusdam nostrum occaecati quas et reiciendis et officiis rerum voluptatem aut dolorum in magnam corporis reprehenderit consequatur eos quo et saepe quas sed enim earum nulla voluptatem qui dolorum omnis natus possimus quod quae alias sit natus repellendus ut aut in aliquam error rem est eos aut eveniet cumque sunt assumenda velit dolores mollitia ut laborum delectus quia qui qui accusantium hic aut corrupti repudiandae sunt esse dolores asperiores laudantium in iusto sed harum dolore nihil ex.', 'Eum debitis ratione quos quisquam voluptatem ex eius nisi est qui et quis aut et dolor et excepturi eius asperiores sint est et optio sint laborum doloribus ut cum sit asperiores totam aut quia excepturi repellat animi explicabo iusto explicabo officiis atque ad aliquid cumque autem quia nesciunt vel quo maiores ab maxime dolor repellendus aliquid voluptas mollitia eveniet voluptas minima tempore expedita perferendis aut occaecati rem tenetur doloremque porro qui magnam culpa ipsum nobis sint et error sunt rem eaque dolorum odit sint facere adipisci itaque enim facilis ut nihil est in animi voluptatem excepturi a enim mollitia amet et aut doloremque sit sit sit recusandae totam.', 622992, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(32, 'Kosan Sitorus', 'Kpg. PHH. Mustofa No. 227, Jambi 92773, Kalteng', 'Pesawaran', 'Vitae ducimus corporis eos perferendis aut asperiores non ipsa ipsum soluta rerum commodi quam dicta et non non velit rerum aliquam odit omnis delectus ducimus placeat et aut officia enim harum nostrum natus molestiae dolorem alias rem magni delectus maxime dolores sunt aut quas praesentium omnis sed eaque quasi non et et dolore sequi commodi corrupti cumque accusantium recusandae fuga quae necessitatibus magnam quae magnam possimus nisi quia unde non harum molestias qui et ut cum odio saepe esse ut aut adipisci aperiam dignissimos asperiores qui omnis odio porro consequuntur maiores aliquam a alias fuga quidem dolor ea quis recusandae maiores id ut placeat dignissimos qui asperiores quis distinctio ullam odio eum voluptatem vero consequatur ea voluptatem in nihil tempore error doloremque harum ut consequatur non atque doloremque saepe.', 'Distinctio voluptatem soluta error quis recusandae ipsam enim libero sit voluptas voluptas aut voluptatum vel mollitia dolore porro at ut voluptatem voluptatibus reprehenderit eveniet sint sed earum nam dolorem repudiandae delectus repellat doloremque aut impedit repudiandae sint eveniet facilis iste ducimus id cumque reprehenderit possimus dolore recusandae aut deserunt repudiandae suscipit molestiae accusantium recusandae vel nesciunt ut ullam cupiditate odit quam distinctio et culpa veritatis distinctio laboriosam at magni quas magni voluptatibus itaque nam modi voluptatem eveniet quia commodi unde nihil vel corrupti autem aut qui voluptatem voluptates eum qui odit accusamus autem saepe eveniet voluptatum perferendis enim recusandae est provident et qui velit at fugiat voluptatem ipsa optio sit aut eligendi consequatur repellendus.', 800069, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(33, 'Kosan Waskita', 'Dk. Wahidin Sudirohusodo No. 478, Probolinggo 28828, Kalbar', 'Lampung Timur', 'Delectus quia consequatur velit dignissimos labore voluptas voluptas deserunt hic unde quia neque et deleniti deleniti atque est omnis consequuntur ab voluptas et ut eum deleniti nihil consequuntur praesentium consequatur rerum facilis velit a consectetur occaecati quod voluptas unde quia temporibus debitis nam omnis dolore molestiae et et omnis distinctio et ea repellendus expedita eaque sit animi itaque quae molestias atque dolor molestiae porro ex nulla laudantium ad molestiae ab magnam rerum atque atque id suscipit ut maxime sunt magni at non eum totam aut accusantium aut suscipit dolor provident est veritatis blanditiis in molestiae ea culpa ut quia odit omnis placeat sint at excepturi vitae voluptatum debitis dolorem iste ut est qui corrupti odit autem quod quasi voluptatum eligendi.', 'Dolore asperiores modi reiciendis ducimus qui voluptatem voluptatem commodi cumque dignissimos ut blanditiis omnis ullam illum architecto maiores eos libero blanditiis enim tempora qui et sed consequatur iusto officia ut aut minus rerum voluptas quasi qui incidunt rerum rem consequatur explicabo nemo totam error libero itaque saepe dignissimos in illo ut illo accusantium facere natus quia nesciunt quo hic temporibus unde itaque deleniti dicta dolor molestiae nobis vero modi natus quo aut est atque ratione adipisci dolor quo quia delectus sed eum enim reiciendis tenetur nulla et sed non consectetur sint cum cumque consectetur mollitia aut iusto libero distinctio placeat et quibusdam in unde soluta dolores aliquid neque nihil qui sed neque porro et suscipit id quia esse.', 525437, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
