(35, 'Kosan Astuti', 'Jln. B.Agam Dlm No. 175, Bengkulu 18155, Kalbar', 'Bandar Lampung', 'Eum repellat aut magni blanditiis blanditiis rerum nobis amet minima autem ut ea vitae animi quisquam quia expedita soluta quia doloremque pariatur rerum inventore sunt tempora adipisci delectus minima vitae aut cupiditate autem ut aliquid optio et laudantium adipisci hic dignissimos quisquam sint atque consequatur distinctio reiciendis provident perferendis qui qui veritatis quisquam molestiae harum temporibus odio qui aut aspernatur occaecati voluptas recusandae ducimus necessitatibus placeat voluptatem iure.', 'Iure id dicta dignissimos quis quis unde in repellendus ratione quo non possimus aperiam exercitationem voluptatibus magnam quia quod veritatis maxime perferendis voluptas fugiat fuga quo ducimus culpa qui harum ratione sit sit voluptas distinctio voluptatem facere sunt rerum laudantium est sit dolor recusandae distinctio aliquid placeat aperiam libero neque voluptatem omnis beatae voluptatibus nihil alias accusamus est minus sunt ipsum rerum aut aspernatur officiis enim et cum accusamus itaque veritatis aut sint corporis dolorem cumque exercitationem vitae suscipit et qui voluptas unde dolores odio ipsam ratione consequatur in deserunt dolores unde fugit eius ex iste eos inventore eveniet omnis fugit illo assumenda quo repudiandae corrupti dolore sapiente provident recusandae illo provident quos debitis voluptates dolorem ut eligendi dolor ex.', 512161, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(36, 'Kosan Yulianti', 'Ds. Raden No. 523, Surakarta 91791, Aceh', 'Tanggamus', 'Dolorem amet cupiditate aut soluta magni voluptate nobis id quia velit illum qui expedita velit officiis velit dicta necessitatibus et hic voluptatem id maxime consequatur dolorem culpa quam labore numquam quidem quia aperiam rerum est recusandae aut atque accusantium eius deserunt veritatis suscipit nobis accusantium aliquid sequi debitis et fugiat est et perspiciatis omnis est laudantium repudiandae ratione totam eveniet voluptates minus sequi dolorem error odit optio autem quia totam blanditiis aliquam nesciunt sit nemo a culpa autem asperiores vel unde accusantium non voluptas voluptate eaque totam quis dicta repellat sint et dolorem ut nihil deleniti nam quod suscipit quas qui maiores eos soluta velit tempore iusto officia eius omnis libero eum doloremque error quod.', 'Voluptate praesentium neque et assumenda molestiae aut et in quia dignissimos dolor perspiciatis qui quia accusantium vitae et ipsa eaque et sed sequi enim unde libero accusamus inventore voluptatum ut ipsum voluptas magnam iste illo perspiciatis consequuntur facere eveniet voluptatibus voluptate qui voluptatem illo laborum eaque doloribus ipsam sunt temporibus non doloremque distinctio repellendus omnis nihil excepturi sed tempora molestiae unde dolore quae odit tempore sunt eveniet vel iure qui ut exercitationem laudantium eligendi a quia quisquam iure quo voluptate porro ipsa harum sunt eum praesentium accusamus ipsum expedita illo totam sit iure repudiandae officia vel minima recusandae voluptas ut molestias id dolorum aliquam itaque culpa.', 697688, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
