(52, 'Kosan Hutagalung', 'Ds. Bass No. 549, Bekasi 60180, Pabar', 'Tulang Bawang Barat', 'Deleniti odit vero eligendi voluptatem voluptates enim earum sit enim mollitia rerum odio quae quos laboriosam ab soluta quia ullam necessitatibus autem tenetur quia quo numquam soluta sunt illum dolores natus tenetur quo harum aspernatur placeat quasi aperiam earum minus temporibus ad laboriosam ea eum vitae est et numquam molestias soluta assumenda architecto veniam explicabo consectetur et velit praesentium repudiandae dolorem provident earum dolorum in est qui sed fugiat saepe delectus rem in rerum autem quis nulla tempora sed earum.', 'Fugiat sit aliquam mollitia fuga blanditiis temporibus ut quod dolores odio sed quibusdam quibusdam dolorem ut dolores totam assumenda vitae et illo sed et omnis alias autem accusantium illo laborum vel quam id quam blanditiis nisi possimus dolorem quos iusto vitae explicabo culpa corporis dolorum ut tempore consequatur nihil saepe fugiat officia alias voluptates voluptas eaque necessitatibus quia deleniti et non magnam harum aut nam ratione optio repudiandae facere ea eius facilis vel expedita possimus quia quibusdam eos quisquam blanditiis ab ducimus repellat voluptatum facilis voluptatem dolor ut eveniet fugiat qui ut voluptatem architecto enim commodi tempora quas ea aut vero voluptas.', 639531, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(53, 'Kosan Mandala', 'Dk. Bayam No. 473, Probolinggo 41697, Bengkulu', 'Lampung Timur', 'Id nam dolores assumenda voluptate eum vel ullam sunt possimus rerum iusto molestiae ut at itaque fugit ut est nam eius est est ea sapiente similique aut sit placeat voluptatem ab reprehenderit in quos mollitia perferendis voluptatibus quibusdam ad modi corrupti eaque ducimus accusamus qui maxime soluta blanditiis consequatur quasi dignissimos est sed aliquid id ea impedit at atque iusto porro aut quo doloribus soluta ipsam magnam unde voluptas temporibus ut doloremque cupiditate voluptas qui tempore alias beatae quo dolor quod temporibus cupiditate officia cupiditate quia sequi labore.', 'Magni deserunt deleniti voluptas qui et est delectus quod repellat quisquam sit accusamus nihil saepe porro iste consequatur eaque cupiditate alias voluptate dignissimos mollitia omnis repudiandae voluptas quae non ab nesciunt maxime est rerum est vero voluptatem sequi perferendis sed aliquam molestias voluptas et explicabo exercitationem suscipit deleniti neque est neque cumque rerum nemo modi possimus aut impedit optio aliquam enim omnis eligendi aut sunt similique.', 702630, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(54, 'Kosan Hutasoit', 'Jln. Bara No. 835, Metro 76150, Sulteng', 'Way Kanan', 'Inventore sed minima qui magnam rem accusantium saepe quaerat possimus commodi neque aut nulla voluptatem quis et sunt inventore atque quis suscipit impedit maiores necessitatibus molestiae cum unde illo est minima et soluta dolorum totam natus quis laboriosam numquam et in laboriosam reprehenderit laudantium voluptatibus possimus nostrum rerum illo est expedita quasi reiciendis et nihil est repellat alias quam rerum quibusdam ab aliquam veritatis explicabo numquam repellat dolores animi aut quis dignissimos culpa eum natus iste deleniti dolorem rerum at dolorum eligendi occaecati aperiam amet provident itaque ea aut natus soluta quisquam sint aliquam omnis quia veniam aut optio aut aut architecto commodi eos et officiis repudiandae nihil maxime sunt repellendus porro occaecati aliquid sint explicabo architecto non inventore quo qui aut eligendi tenetur consequuntur molestiae excepturi ut et nostrum dolores.', 'Accusantium dolorum quam aliquam odit vero quia corrupti officia aut aut aut repudiandae fugit dolorum delectus saepe quam doloremque in incidunt voluptatem quibusdam placeat et maxime accusantium saepe temporibus ad architecto nisi sint cumque cum illo qui est earum necessitatibus occaecati consectetur voluptatem ut est sint a deserunt et ipsam sunt vel et est doloremque est sed eius similique omnis ut qui nesciunt qui distinctio iste id fugiat voluptas qui nemo aspernatur deserunt perferendis iusto nam ut corporis voluptate rerum sed debitis et et nam voluptatem non officia tempora ut eveniet et qui eos nihil mollitia adipisci sunt debitis aperiam et sapiente magnam sint laudantium quos possimus consequuntur aut voluptas eius iure sint voluptas amet a facere.', 828689, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(55, 'Kosan Laksmiwati', 'Ds. Sukabumi No. 162, Tidore Kepulauan 16763, Jateng', 'Lampung Selatan', 'Labore voluptatem earum voluptatem deleniti error hic fuga facere et doloribus fuga facilis tempore aut et eius sit quidem sed culpa aliquid repudiandae nesciunt delectus quia pariatur cupiditate repellat ratione alias quaerat debitis a voluptas officia dolor est repudiandae qui voluptas minus rerum sit cupiditate nesciunt recusandae sit consequatur qui odit perferendis enim eligendi sint est iure id labore sunt porro culpa velit quo qui voluptate sunt occaecati explicabo laudantium rerum hic soluta aperiam commodi fugiat quos qui adipisci tempora qui corporis est in vitae excepturi necessitatibus ipsa fugit illo itaque ipsa beatae ipsum omnis tempora a enim quas tempora aut repudiandae quia veniam architecto dolorem sed repudiandae ut assumenda sapiente porro quia et quia expedita et quod nisi id labore aliquid cum cupiditate ab et est saepe maxime omnis.', 'Itaque sit deserunt adipisci itaque laboriosam sit corrupti blanditiis eaque voluptatem distinctio amet harum et illum qui nihil assumenda natus earum quo culpa saepe temporibus alias sit quidem dolores non itaque alias quam est illum debitis quasi omnis est ducimus sint et excepturi officia exercitationem amet et nemo aut aut dolorum eveniet esse eos facere autem tempore eius officia perspiciatis rerum molestias praesentium rem aut maiores id est optio a distinctio natus omnis praesentium sapiente dolor nesciunt optio et voluptatem culpa perspiciatis autem ea ut possimus doloremque qui cupiditate a et quam cumque est nobis doloribus corrupti sequi et et consequuntur rerum nisi et nemo repellendus qui quo consequatur.', 946426, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(56, 'Kosan Wibowo', 'Jln. Batako No. 957, Pekanbaru 68871, Sumsel', 'Way Kanan', 'Dignissimos eos expedita voluptatum vero doloremque quo qui et officia aut molestiae doloribus molestiae sequi qui voluptatem unde quo consectetur tempore accusamus vel blanditiis quas culpa nam nam fugit facere est provident odit ut iure neque autem nisi ut ut qui omnis qui possimus veritatis autem nostrum ducimus dolorem quia accusantium est dicta nisi quia qui blanditiis commodi id non praesentium pariatur blanditiis ex nihil maiores architecto molestiae impedit et animi blanditiis cumque quis iusto ratione corrupti et in sed asperiores cupiditate et exercitationem non atque quasi unde id officiis sed est suscipit ut explicabo rerum rem quia consequatur aut aut rem labore sit repudiandae et placeat occaecati aut repellat voluptas quo id et et est sit sapiente quis asperiores cum laboriosam et sapiente molestiae sit eum quos ex velit sit sunt nostrum.', 'Quasi nesciunt labore molestiae voluptate ea qui qui possimus praesentium laborum rerum commodi nam culpa saepe quo et expedita blanditiis vel ut iure odit officiis sunt ullam minus facilis ullam et facilis temporibus doloribus voluptas sint possimus ullam ullam repellendus ullam quidem deleniti omnis amet ipsum quod quo saepe nemo explicabo ad voluptas libero voluptatem explicabo quia est dolore ullam veniam sit est in nobis facere quod ea quo vel ut non qui ut earum eveniet qui vitae debitis non molestiae tenetur natus quasi quae recusandae dolor facere sapiente esse deserunt dolor nihil est labore modi porro nostrum ut aliquam veniam id ducimus cum distinctio architecto iure sint esse explicabo.', 550680, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(57, 'Kosan Puspasari', 'Ds. M.T. Haryono No. 368, Tarakan 47848, NTT', 'Tanggamus', 'Aliquid molestiae perferendis quas porro porro non iure odit deserunt veniam eius excepturi ab a quidem fugiat modi distinctio ut repellendus totam deleniti suscipit mollitia unde deleniti et dolor in et quod modi aut vel consequatur et maxime ullam deleniti sapiente voluptatibus sit impedit non ea et non iste doloribus eos eveniet nulla nemo sit recusandae accusantium dolorum sed pariatur nihil id sit consequatur eius ipsam aut rerum excepturi accusantium voluptates.', 'Libero voluptates quia voluptatum voluptatum commodi esse quidem soluta ut iure sed rem atque ducimus magnam incidunt dolore ut fugit atque id nisi consequuntur delectus laudantium vel velit quia quia quam quos blanditiis qui voluptatem doloribus quia ab aspernatur quae asperiores nesciunt ut perferendis laboriosam quia optio voluptatem eveniet est ut in qui blanditiis est consequatur reiciendis non autem non praesentium voluptate rerum voluptatem autem eligendi consequuntur atque vel quo expedita in neque et eum voluptas nihil aut nobis quis aperiam eius culpa ea aspernatur porro quibusdam quam sit illum vitae sed aut quas animi qui et ea sed dicta eos officia quisquam ullam aspernatur repellat expedita voluptate corrupti autem nobis ut quia voluptates a dolorum eum et sit.', 788290, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(58, 'Kosan Yulianti', 'Jr. Flores No. 244, Medan 94905, Sulut', 'Pesisir Barat', 'Quisquam sint tenetur ut soluta inventore fugiat reiciendis commodi quidem eligendi laboriosam et corporis ut voluptas nam quos saepe laudantium cum corporis animi ut hic doloribus blanditiis rem deleniti debitis qui eos maiores eum et quibusdam voluptas ut maiores accusantium facilis expedita dolor rerum laudantium aliquam repellendus quos nulla repellendus aperiam ab quod culpa delectus consequatur dicta repellat eius ut aut ullam fugit corporis ipsum vitae ut impedit ut occaecati consequatur velit ducimus sunt odit quae et suscipit molestiae molestiae et excepturi fugit odit quia impedit delectus eos repellendus officia consequatur sit qui aperiam dolorem sint eum cupiditate.', 'Totam qui eos repellendus explicabo beatae beatae possimus voluptas quia fuga eaque minima iste velit iure harum sit qui expedita error quia modi asperiores natus voluptatem at blanditiis est veniam nihil pariatur totam corporis commodi sunt et dolorem culpa necessitatibus dolorem temporibus qui est eos est nihil cumque adipisci et nihil qui consectetur nulla dolorem dignissimos earum animi aspernatur aut ea nemo corrupti.', 993364, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(59, 'Kosan Hidayat', 'Dk. Suryo Pranoto No. 357, Bau-Bau 97125, Babel', 'Metro', 'Aliquam iure dicta inventore ut dolorem ab quae quisquam eaque est cum asperiores corporis enim qui beatae aut optio molestiae est nesciunt explicabo ratione cum quos id officiis totam in odio placeat deserunt consequuntur perspiciatis rerum tenetur in itaque quam maiores quos ea aut amet minus tenetur eius vitae occaecati minus non ipsa repudiandae expedita magnam enim neque rerum error magni aliquid occaecati cumque et ut illum.', 'Architecto blanditiis voluptatem omnis quibusdam voluptas nesciunt possimus rerum quia laudantium fugiat et quasi rerum distinctio sed voluptate ut ipsum eius consequatur qui eum perferendis odio aut fuga libero mollitia impedit est et neque magnam inventore earum corrupti possimus mollitia nihil qui eaque nostrum deleniti veritatis qui dolorem magni aliquid architecto neque voluptas voluptate voluptatem aut aliquam vel enim qui magnam iure omnis dolores atque quo repudiandae rerum debitis.', 860726, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
