(61, 'Kosan Prasetya', 'Dk. Bagas Pati No. 229, Cirebon 29771, Maluku', 'Lampung Utara', 'Consequuntur vitae perferendis est magnam aut earum perspiciatis veniam voluptatem a maiores non incidunt veniam atque est et veritatis ut beatae inventore ut sunt aut aspernatur reiciendis voluptas at est blanditiis tempora ut ipsam deserunt deserunt voluptas est dolorem quia ut explicabo fugit odit repellat ratione architecto et veniam ea vitae quos non doloribus officiis aut omnis reprehenderit voluptatem neque quibusdam accusamus ut consequuntur tempora earum repellendus voluptas ratione reprehenderit accusantium doloribus quam nesciunt inventore beatae voluptatem ratione autem dolorem est modi a aliquid iusto aut ab ut voluptatem quam dolores ut nulla rem perferendis similique aspernatur.', 'Voluptatem in molestiae aperiam ipsam ullam repellendus nemo rerum sit voluptate nesciunt ea magnam iusto non harum perspiciatis dolorem tempore minus dolorem accusantium voluptatem sed totam occaecati est reprehenderit earum qui et reiciendis totam ut eaque sed tenetur quia in quibusdam nisi officiis deserunt quisquam suscipit delectus alias perspiciatis eligendi illum quod dignissimos quis accusantium omnis ea accusamus aut tenetur modi fugit explicabo voluptates dicta facilis quibusdam enim ipsum dicta sunt molestiae minima dignissimos commodi beatae id aperiam recusandae voluptas architecto ea quam aut quidem consequatur et nam libero illo assumenda est dignissimos sed qui blanditiis optio consequuntur quisquam qui nihil reprehenderit doloremque optio voluptates ullam consectetur saepe aliquid officia in et nesciunt odio rerum possimus facilis reiciendis numquam placeat aut.', 962384, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
