(63, 'Kosan Novitasari', 'Dk. Dipenogoro No. 564, Bandar Lampung 77384, Sumut', 'Way Kanan', 'Qui aut id cum recusandae magni quibusdam ab praesentium nesciunt unde autem numquam quis voluptate maiores eligendi possimus voluptas omnis quod unde molestiae voluptas consectetur quis consectetur provident numquam voluptas quia debitis reprehenderit voluptas corporis hic fuga quia omnis quae dolores illum nesciunt tempore possimus ab ratione aut quod a eveniet ut nobis placeat et ut nam sunt laudantium nobis inventore ducimus.', 'Id corporis ea iste quae omnis quis sed fugit voluptatem qui commodi nobis ut animi sit nam modi eaque impedit similique et ea molestiae porro est incidunt eos quibusdam et tempora explicabo neque explicabo pariatur rerum suscipit maiores ut culpa fugit qui quia aut repellat doloremque sint et quidem et assumenda temporibus commodi error cumque sed qui magni sit nostrum eos sapiente ipsa est dolorum in doloribus provident assumenda est consequatur expedita sint quaerat alias natus et ullam velit et voluptate aut corporis exercitationem libero soluta saepe eum quas perferendis dolorem sunt rerum nihil et quibusdam alias provident quia vitae alias aliquam molestiae voluptas sit impedit laborum quo in fuga occaecati rerum tempora provident labore quos vero tempore omnis ut delectus ad sit.', 745264, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(64, 'Kosan Samosir', 'Gg. Ciwastra No. 358, Batu 38048, Lampung', 'Way Kanan', 'Eos id repudiandae minima quae labore necessitatibus omnis recusandae et atque omnis blanditiis dolorem placeat et nihil quia reprehenderit itaque reiciendis ab cupiditate minima asperiores distinctio facilis cumque a tempora quo suscipit optio doloribus et rem aut unde consequatur non placeat earum nihil eligendi aut quibusdam blanditiis eos atque vel et voluptatem qui totam aspernatur pariatur corrupti quia aut dolores dolor ea velit ipsum.', 'Quibusdam sapiente praesentium rerum quo et consequatur ut dicta quasi quia esse doloribus ipsum ipsam fuga dignissimos dolores adipisci sapiente tempora non corrupti voluptas earum ad possimus iste maxime soluta dolores facere ut est deleniti impedit aliquam quia illo qui sint quos est ut quaerat autem voluptatibus quaerat ipsum quas sint molestiae adipisci omnis mollitia assumenda ipsam suscipit porro inventore ut ut quia rerum dolorem nostrum quas dolor quis voluptatibus nisi a iure aut adipisci eaque in voluptas temporibus deleniti mollitia est ut dolores voluptatem deserunt sed voluptatum doloribus soluta illum.', 927355, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(65, 'Kosan Zulaika', 'Jr. Ketandan No. 691, Pagar Alam 68010, Kalbar', 'Lampung Utara', 'Numquam illum autem veritatis et sint et distinctio dolor et ut earum odio nihil quis nemo et non eos aut et distinctio dolore vel eligendi inventore qui alias necessitatibus ratione laudantium illum porro occaecati porro molestias est explicabo iure odit soluta inventore consequatur dolorem iste laboriosam optio minima velit provident est voluptas quasi corporis magnam quo accusantium et repudiandae quae veritatis libero officiis ut praesentium qui eaque repellat voluptas ut impedit est nihil enim quibusdam eos nisi porro deleniti labore ad est et soluta perferendis dolores exercitationem nulla et quisquam laboriosam libero ut eveniet nam praesentium quia quibusdam voluptates nulla amet quis ad sed perferendis aut quas sed temporibus quod sunt distinctio sit temporibus et ut sequi dolore enim mollitia ex excepturi hic vitae ea et eaque qui ratione.', 'Nobis est ut sapiente necessitatibus illum nemo aliquid esse autem nihil eligendi sit rerum eius voluptatem dolore dolor dolor quis aut ut rerum cupiditate quis asperiores modi quae veritatis dolor ut ducimus voluptatibus voluptates velit voluptatibus inventore dicta laudantium expedita ab omnis nostrum harum qui iure voluptatem dignissimos veritatis et dolores architecto totam sint eveniet maiores dolores et temporibus voluptate vel perspiciatis necessitatibus qui maiores consequatur et saepe accusantium vitae nobis dolores.', 801559, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(66, 'Kosan Prakasa', 'Jln. Rajawali Timur No. 969, Banjarmasin 31679, Jatim', 'Lampung Barat', 'Ex sapiente nulla optio deleniti id incidunt nihil enim ratione occaecati quaerat est delectus suscipit quis eos ut et quae aut vel quia dolore molestias qui maiores eum deleniti ut et nesciunt perferendis deserunt sit et et minima aut aliquam omnis at ab nostrum porro tempore dolorem ullam possimus laborum eligendi nemo porro et voluptatibus libero illo maxime qui officiis quis quam voluptate facere laudantium quaerat velit impedit aut dolore quam ipsam quis tempore et debitis voluptas magnam et ipsam praesentium adipisci quas.', 'Ut at labore deleniti nisi maxime magni at est qui autem ducimus ab facilis molestiae enim explicabo assumenda harum magni tenetur et et officia voluptatum dolores sed dolor ducimus rem aspernatur asperiores voluptas eos rem cumque inventore culpa ea consectetur dolor quis accusantium dolor temporibus cumque qui qui soluta et et soluta vel provident eius laudantium et quam dolore voluptas odio similique sit ut voluptatem nesciunt animi dolores est sed excepturi praesentium quibusdam provident aut rerum perferendis earum quod odio vel modi delectus ratione corrupti magnam beatae inventore delectus id molestias totam magnam sapiente nemo dolor.', 582427, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58');
INSERT INTO `kosan` (`id_kosan`, `namaKost`, `alamat`, `kota`, `deskripsi`, `fasilitas`, `harga`, `type`, `idPemilik`, `created_at`, `updated_at`, `deleted_at`) VALUES
(67, 'Kosan Firmansyah', 'Gg. Veteran No. 493, Banjarmasin 53785, Jateng', 'Lampung Barat', 'Dicta molestiae qui quidem mollitia nobis omnis a excepturi inventore eligendi sit sunt mollitia eum vero maxime unde qui quae magnam laboriosam sit saepe cumque sed totam nulla quos quidem temporibus facere vel et consequatur sint enim sed inventore dignissimos minus aliquam impedit incidunt et voluptas sed dolorem quia optio non eius veniam aspernatur voluptatum neque dolores blanditiis excepturi quo aliquid dicta libero molestiae autem a dolorum voluptas nemo magnam dolorem voluptas numquam quasi nihil vero sint occaecati aut repellendus consequuntur rerum.', 'Culpa ut nemo labore rem porro maxime sed et illo voluptate quaerat qui voluptate vel veritatis mollitia laborum et architecto rem illum molestiae enim occaecati at libero id quis soluta cum ex expedita dolore asperiores id blanditiis dolor rerum amet accusamus alias consequatur rerum sit excepturi est iste consequuntur laborum cum sit quis harum qui assumenda mollitia sint inventore provident eum labore ut sint aut commodi qui dicta rerum sed fugit sint eum quam vel velit aut earum et reprehenderit ducimus perspiciatis quia est sunt architecto mollitia nobis ut laborum hic aut magnam et aperiam odit id nemo recusandae soluta nisi quam occaecati voluptatum libero et aut et provident a rerum expedita ullam repudiandae dolorum accusamus.', 598861, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(68, 'Kosan Simbolon', 'Jln. Tangkuban Perahu No. 720, Salatiga 46939, Sulbar', 'Metro', 'Quaerat voluptates libero vero occaecati rem sunt nostrum id qui ut eius et sequi repellat rerum in ducimus ex et quis maiores ipsum qui iusto quibusdam atque dolorum natus dolorum consequatur sunt qui voluptas architecto doloribus quaerat fugiat repudiandae laborum qui aperiam quaerat id rerum et voluptatem corporis labore laborum qui debitis possimus iste aut dolorem minima ratione ut quisquam et corporis ratione ipsum quos enim asperiores vero aut quidem maxime blanditiis molestias dolores eos aspernatur totam amet voluptatem enim veritatis culpa omnis culpa cum vel laudantium unde asperiores labore in pariatur autem ea eligendi consequatur sapiente fuga cupiditate asperiores et quia nihil ea id deserunt voluptate eligendi dolorum tempore non.', 'Assumenda ut aut voluptas nobis distinctio sed qui vel autem fugiat error nostrum qui animi ea quis voluptates voluptatem quia eius omnis aperiam quae qui ab aut tenetur nemo et commodi expedita harum recusandae labore dolorem aut quis in nihil libero eius voluptatem praesentium ut nulla molestiae temporibus quis aut qui deserunt est harum cumque aut harum velit nemo vel deserunt ut autem tenetur et nulla quos eos unde quaerat dolores est ullam officia ut alias accusantium necessitatibus eaque incidunt ipsam nam facere ipsam ab aut officia voluptates autem.', 910595, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(69, 'Kosan Hasanah', 'Jr. Batako No. 249, Magelang 52205, Sumbar', 'Tulang Bawang', 'Veniam accusantium sit consectetur consequatur voluptate eaque eaque nam eum aliquam vitae sunt voluptas laboriosam unde necessitatibus in nihil dolorem iure commodi voluptatem nihil unde quod earum mollitia sit nemo perspiciatis voluptas delectus dolorem sunt pariatur quasi est maxime ratione quibusdam dolorem quas vel et natus quasi eaque neque fugiat ratione dolorum non qui hic et dolor non labore sunt nihil quos consequatur voluptas fuga illum velit quaerat corporis vero ad exercitationem vero accusantium eum ipsa laboriosam quos quasi non perspiciatis et ipsum quo minima dolorum voluptatem corrupti quam alias cumque eos culpa corrupti in impedit deleniti enim ab voluptatum quis et nihil laborum fuga inventore veniam dolorem voluptatem consequatur ducimus praesentium quidem ad dolorum cum accusamus vitae ut ex fugit vel nam veritatis numquam ipsam qui repellat voluptates a ratione quasi nostrum.', 'Et repellendus quas minus quos qui id voluptatem ut autem laboriosam sit quia ea corporis voluptatem accusamus et eum enim impedit odit adipisci aut dolorem ea veniam dolore in atque nobis quas doloribus eius nam qui libero quae modi voluptas ex qui illum sed nesciunt sapiente odio est dolore expedita nihil et architecto quisquam id quis omnis officia sint suscipit neque officia dicta qui iste nulla repellendus eligendi praesentium dolor voluptatibus eius animi repellat aliquam assumenda esse aut dolor quasi quis officia non ullam fuga sit quia saepe vitae assumenda et voluptatem autem autem pariatur ipsa porro suscipit repudiandae vel debitis eveniet eum non et unde ut dolore ut omnis ad labore eos praesentium laboriosam doloribus est consectetur earum error iure doloremque est eum.', 501681, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(70, 'Kosan Lazuardi', 'Ds. Krakatau No. 116, Palangka Raya 96934, Maluku', 'Lampung Selatan', 'Rerum et culpa est ipsam qui ipsam aliquam et rem suscipit non et quibusdam alias magni iste dolores sit dolorum eveniet numquam quos deserunt impedit et dicta rem qui cupiditate alias harum qui debitis sunt dolorem omnis sequi consectetur et at id asperiores et eum placeat et voluptas saepe explicabo provident soluta quis consequatur temporibus illo doloremque voluptate id provident rem quod minima a deleniti molestias libero tenetur optio assumenda est voluptate dicta dignissimos aut nobis ut et quia rerum sed rerum sed provident aut rem voluptatem est magnam dolores quibusdam vel et dolor tempore voluptatem sed quis laboriosam neque rerum voluptatibus velit nam ducimus temporibus aliquam voluptatum qui libero molestiae voluptatem nihil consequatur voluptas sunt eligendi delectus.', 'Illum exercitationem qui fuga veritatis consectetur dolore ducimus facere veniam aperiam consequuntur consequatur laudantium id qui et doloremque ab qui vel in provident veritatis amet rem commodi modi et rerum placeat eius et dolores dolores rerum itaque vel laudantium est illo velit sapiente reprehenderit occaecati quia excepturi qui rerum ad autem quam eos veritatis sit dolorem veritatis voluptatem occaecati a cupiditate quia et et error enim aut maxime pariatur eaque est delectus similique et rem aliquid quo aut voluptas aliquam voluptatem est sunt esse molestiae quidem deleniti quia et ut eum voluptatum rerum beatae reiciendis unde fuga nam voluptatibus quia rerum occaecati velit quas corporis quia eum eveniet amet impedit dolore molestiae velit assumenda aut aut rerum omnis suscipit facilis minima magni minus voluptas sint adipisci nihil nisi nesciunt aperiam necessitatibus ratione odit possimus mollitia mollitia.', 974688, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(71, 'Kosan Sihombing', 'Dk. Setiabudhi No. 702, Bima 48551, Sulteng', 'Metro', 'Eos odit ad repellat porro velit itaque incidunt quis natus et dignissimos consectetur dolores quia iure minus consequatur nihil ipsa et quaerat deleniti quisquam quibusdam est commodi eos iusto in illo suscipit et alias repellendus accusantium ab quia impedit eius est deleniti nobis velit debitis tempora nobis occaecati dolore enim laboriosam commodi ullam magni veniam praesentium atque minima quia voluptas vero est labore hic reprehenderit sint nesciunt doloribus quisquam maxime corrupti commodi id illo odio illum cumque ab et qui non qui molestias est id incidunt eum quia qui quae placeat nihil incidunt tempore et aut odit et culpa reprehenderit expedita at reprehenderit occaecati nihil non accusantium dicta.', 'Quam et architecto sunt doloremque debitis optio voluptatem praesentium nobis at dolor exercitationem et magni quisquam aut quo quis sint doloribus qui sed rerum ut voluptates iure rerum perferendis dolorem placeat dolores voluptatum voluptatibus vel voluptatum et doloribus quia voluptas voluptate exercitationem vel excepturi consequuntur accusamus voluptatem qui voluptatem sunt quis in quia ut eaque temporibus dolor harum placeat impedit qui vel a quia rem sequi maxime voluptatem consequatur nesciunt totam et sunt est veniam voluptatem rerum et earum magnam nisi velit a sapiente eum dolor rerum dolorem omnis esse error itaque fuga quas autem voluptatem voluptas.', 977934, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(72, 'Kosan Farida', 'Jln. Tentara Pelajar No. 255, Cilegon 78582, Banten', 'Bandar Lampung', 'Ea est error cum ex vel aliquam ad molestiae aut et fugiat ut tempore rerum sapiente autem rerum qui officia nostrum similique eligendi quod adipisci rerum tenetur voluptatem modi non accusamus dolorem animi natus esse exercitationem ullam temporibus explicabo omnis laborum qui numquam optio ut possimus eius ab tempora ea aut reiciendis ut ducimus saepe culpa officiis deserunt iure maiores est sunt expedita quisquam veniam necessitatibus necessitatibus exercitationem debitis doloremque et inventore incidunt sit eos perspiciatis aliquid eaque dolor nemo assumenda harum.', 'Quasi dolor praesentium fugiat voluptatum quia quasi delectus blanditiis veritatis consequuntur ea eum sunt excepturi at fuga perspiciatis facilis corporis voluptatem delectus nobis est eius ab repudiandae voluptatem similique commodi et praesentium quisquam aut voluptatem occaecati doloribus sunt quae ab iure ea vero saepe at eos qui odio consequatur tempore a voluptas accusamus eos nulla aut accusamus est quibusdam est officia dicta nam rerum omnis iste molestiae non neque earum.', 698460, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(73, 'Kosan Nurdiyanti', 'Psr. Baja No. 48, Tidore Kepulauan 48616, Kepri', 'Tanggamus', 'Tenetur provident neque quo dolorem vel modi ex aut iste qui natus cumque libero dolorem magnam id illo dolorum cum molestias non rerum consequuntur est ipsam nam eum pariatur rerum quia qui voluptatem qui asperiores harum sunt dignissimos sequi aliquam expedita nostrum fuga sed aut doloremque consequatur necessitatibus cupiditate sed aut voluptas tempora ducimus quia est beatae pariatur consectetur fuga sed similique voluptatem dolore et nulla ullam odit non totam sit impedit magnam magnam qui magnam et ad temporibus eos soluta sint et accusantium sed magnam reprehenderit voluptates dolor ea sapiente ut eum reiciendis placeat facilis est autem et at.', 'Officiis neque quisquam aut illo et quia ullam molestiae voluptatem commodi nostrum id et voluptatem perferendis aspernatur et vitae reiciendis deserunt laborum sint adipisci delectus sunt voluptatem voluptatem culpa provident ut ut voluptatem et qui cupiditate nemo quia est aut odit ducimus nemo et odit est quod possimus quasi fugiat aut est sit eius corporis consectetur provident ducimus est inventore et expedita ut aut veritatis eos quas facilis provident aliquid alias mollitia quaerat qui vel rerum a ducimus consequatur doloremque quia officiis accusantium sed aut dolorum praesentium omnis et mollitia ullam non neque ullam ut similique illum fugit sed dolorum praesentium.', 522723, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(74, 'Kosan Puspita', 'Ki. Dipenogoro No. 643, Pagar Alam 37219, Lampung', 'Tulang Bawang', 'Consequatur voluptatem laborum voluptatibus veritatis voluptatum omnis tempore perspiciatis quod ratione ut quibusdam voluptas est est debitis consequatur praesentium et dolorem similique perspiciatis rerum et pariatur consequuntur et esse similique aliquam perferendis accusantium velit vero laboriosam dolor eos libero dolor autem quo exercitationem sit dignissimos a possimus dolorem deserunt rerum reprehenderit similique harum ullam nihil saepe similique officia qui ducimus quis quaerat.', 'Qui hic minus nobis numquam consequuntur harum temporibus est atque fugiat qui incidunt est sint rem rerum consequatur et commodi explicabo voluptatem est tempore id numquam consequuntur debitis iure libero qui animi dolorem nihil ducimus molestiae incidunt et magni odit officia quia impedit totam assumenda ab est nemo dolores aut fuga facere dolorum molestias beatae modi similique sapiente earum et ut non sint impedit nam perspiciatis ut sed et fuga assumenda magnam quisquam rerum voluptatem et dolores incidunt ut ut quam recusandae hic deleniti cupiditate error nemo veniam placeat nemo eum maiores ut quisquam et itaque explicabo sint at illum fugiat qui corrupti eos et corrupti dolores quia.', 825397, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(75, 'Kosan Nababan', 'Psr. Baladewa No. 594, Makassar 35600, Malut', 'Tulang Bawang Barat', 'Dolorum vero laboriosam aspernatur molestias sequi eos accusamus rem saepe ut odit iusto doloribus amet id est nemo ut animi incidunt quasi voluptatum unde nihil consequuntur facilis tempore quam enim odio omnis dolore maxime voluptate sit officiis vero adipisci aut aut dignissimos cum sapiente dolorem voluptas nihil ut sit qui sed omnis eum officia sequi voluptatem voluptas repellendus laudantium iste sit eos culpa fugiat voluptas harum illo consequatur inventore qui exercitationem quaerat dolorum explicabo nisi assumenda sequi aut.', 'Et quia blanditiis totam aut architecto saepe saepe amet dolorem officia incidunt enim temporibus rerum id necessitatibus sint itaque voluptas quis et voluptatem earum aut occaecati voluptatum fuga beatae aut vitae inventore non odit et sint porro delectus eos suscipit aut tempora consectetur aut assumenda sint libero maiores ut minima dicta doloribus dolor eum id rerum veritatis odio aut architecto error dolorem aut ea non quam fugiat sequi enim sapiente commodi consectetur quisquam eum tempore nisi nam at impedit dicta vitae possimus in quod doloremque cum totam dignissimos ipsam enim aut corrupti deleniti cupiditate deserunt vitae est nihil at quasi et totam qui aspernatur corrupti praesentium repellat pariatur et perferendis non dolorum aliquid omnis blanditiis et neque est nihil est et incidunt sed tempore vel deserunt eligendi quo maxime perferendis cumque.', 602338, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(76, 'Kosan Nugroho', 'Dk. Jakarta No. 133, Pasuruan 86126, Sumsel', 'Pesisir Barat', 'Iusto ratione modi soluta blanditiis inventore temporibus odit non vero dolorum quidem cupiditate nostrum adipisci amet quaerat magni quidem qui modi laborum facilis dolore voluptas quia vel qui cum soluta iste voluptatibus accusantium velit non voluptates architecto necessitatibus consequatur ab praesentium nam autem ipsa corporis suscipit sequi consectetur aut numquam dolorem saepe sed et delectus dolor eligendi ut a saepe aliquam qui quia eum provident omnis rem dicta quis ipsa repudiandae quia placeat cupiditate vel qui qui maxime iste praesentium minima nostrum beatae quas aut sit deleniti molestiae ipsam sit ut pariatur perspiciatis maiores sed pariatur nisi consequatur animi et qui laborum ut ut qui numquam sit dolorem qui cumque vero iure magni at.', 'Earum tenetur qui cum odit alias reprehenderit ipsa ex rem omnis voluptatem incidunt omnis et laudantium ut esse sunt praesentium quibusdam eaque sed inventore quasi excepturi commodi id voluptatibus dolorem et et consequatur laboriosam eum ad at non reiciendis quidem corporis similique aliquid accusantium quibusdam quisquam voluptates aut non numquam consequatur et nobis et unde molestias maxime expedita enim accusantium et earum tenetur et tenetur nam quia nostrum ea enim culpa id aut adipisci.', 689594, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(77, 'Kosan Purnawati', 'Gg. Ciumbuleuit No. 53, Bima 74607, Sultra', 'Tulang Bawang', 'Eligendi corporis minima occaecati architecto ratione atque inventore omnis vel non maxime et in qui autem officiis perspiciatis neque voluptates ea consequatur voluptates qui quod hic cum placeat et nobis rem quia soluta nesciunt recusandae et perspiciatis enim repellat aut corporis et et sit ut quos error et hic non ut excepturi hic illum odio modi sapiente quia facilis temporibus dolor velit vel sint porro beatae voluptatum et laboriosam qui praesentium distinctio sequi quia quis aliquid nisi in deleniti quaerat non eum voluptatibus eum omnis eos reprehenderit voluptas quidem ratione animi et odio voluptatem tenetur dicta possimus consequatur nesciunt consequuntur dicta.', 'Architecto maiores qui vel mollitia aut minima illo nesciunt ea quis omnis quas et consequatur optio consequatur consequuntur iste labore aut esse architecto minus pariatur aut soluta vel officiis itaque laudantium beatae dolorum numquam autem reiciendis suscipit quia aliquam ducimus ex deleniti voluptatem enim possimus eum temporibus doloribus dolor laudantium molestiae dolorem molestiae facilis laudantium harum et vel sint sint odit maiores laudantium sed ducimus excepturi aut ut minima accusamus sit et et facilis ut occaecati doloremque cupiditate at enim ducimus eos ad est vel tempora id dolor voluptatem corrupti quod modi itaque rerum impedit totam blanditiis corporis vitae repellat quas enim sapiente non consequuntur minima laborum voluptatem nesciunt aut dicta quia ullam voluptatem rerum et illum dolor nesciunt culpa qui consequatur repudiandae et.', 953888, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(78, 'Kosan Maryati', 'Gg. Batako No. 749, Gorontalo 19088, NTB', 'Tulang Bawang', 'Ab alias esse velit rem sed maxime non et officia nihil et rerum reiciendis sunt porro ut molestiae sint deserunt nihil aut totam et vero aut voluptatem voluptatum ut sapiente exercitationem facilis nesciunt aut laborum minus eos dolor facilis commodi vel qui nostrum suscipit et autem ut cumque eaque est eligendi iusto dolorum sapiente rerum mollitia labore impedit voluptatibus aspernatur nostrum asperiores modi repudiandae mollitia nesciunt accusamus alias aspernatur aut maiores modi sint similique et doloribus ducimus aut ea dolores deleniti error voluptates quaerat odio sit qui id non sunt consequatur qui rerum ducimus nemo ut quia rerum ut eveniet nobis adipisci et.', 'Voluptatem consequatur porro corporis saepe ipsam suscipit velit laudantium inventore blanditiis officiis nulla maxime mollitia porro odit voluptas sint tempora dolor accusantium voluptas unde nostrum cupiditate sunt pariatur dolor id sunt hic sequi ullam ut aut id repellat incidunt impedit esse culpa cum nesciunt consequatur rem laboriosam labore voluptas nesciunt dignissimos qui totam aut nisi beatae autem dolores qui laudantium quia omnis consectetur officiis natus accusantium quia porro accusantium enim consectetur quia esse maiores similique quidem nobis tempora doloribus ea nihil voluptatibus fuga odit possimus impedit sunt libero et consequatur esse omnis aut doloremque ipsum aspernatur aut dolor officia quod optio assumenda facilis harum assumenda unde explicabo quos eum modi est iste error omnis nemo natus quia ducimus.', 733752, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(79, 'Kosan Prakasa', 'Jr. Kyai Gede No. 252, Bekasi 47325, Sumbar', 'Tulang Bawang', 'Eum perspiciatis qui et consectetur consequatur earum inventore architecto autem est accusamus vero id totam veniam architecto tempore esse veniam nulla voluptas dolor doloribus sed adipisci repudiandae necessitatibus amet et commodi eos ipsam cupiditate et qui suscipit velit porro facilis omnis ut voluptas tempore et perferendis in commodi rerum corrupti ex mollitia consequuntur quia ea tempore consequuntur odio et blanditiis nisi sit adipisci cumque id quo impedit optio esse aspernatur blanditiis sapiente harum voluptatem necessitatibus quis autem molestiae quasi temporibus quas est occaecati natus consequatur ut temporibus mollitia qui qui sunt perferendis consequuntur reiciendis quo saepe occaecati est sunt accusantium qui enim iusto possimus quis voluptatibus nihil officia assumenda sit aliquam modi et fuga id sint tempora debitis.', 'Quia architecto nesciunt est ad aut rem a asperiores temporibus velit sequi ut ut sunt ut autem quia non nesciunt laudantium commodi error excepturi nesciunt qui nostrum cum necessitatibus magnam provident exercitationem doloribus alias earum veniam aliquid amet sit est quidem impedit commodi iste esse totam sapiente magnam dolore aut aut explicabo quo tenetur qui culpa voluptas ipsam est vel occaecati ut blanditiis dolorum necessitatibus quia quo porro et unde odit quia provident maiores doloribus est similique iusto excepturi ut repellendus et ducimus sed occaecati architecto fuga quidem vitae excepturi quibusdam ratione et alias dolor qui laboriosam molestias quo facilis sint iure ipsum accusantium ullam rerum aut aut pariatur et magnam veritatis quae quaerat voluptatibus ipsa et illum molestiae in ut error aut similique placeat esse consequuntur nisi sint consequatur consequatur et repellat placeat dignissimos laboriosam.', 842270, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(80, 'Kosan Riyanti', 'Ki. Padang No. 901, Tidore Kepulauan 37082, Bengkulu', 'Tulang Bawang', 'Provident doloremque quia perspiciatis nesciunt culpa porro ut tenetur cum velit cumque doloremque sunt ducimus et magni pariatur quasi porro quia architecto sapiente et voluptatem blanditiis eligendi nulla in est minima est sint eius porro quaerat temporibus nisi quaerat provident dolorem omnis sunt rem voluptas ea aut praesentium alias sit voluptas dolores similique tempora eligendi est possimus adipisci est aut aliquid molestiae id minus necessitatibus.', 'Et et ipsa alias nihil eius ut est eligendi voluptatibus et sed eum et voluptate et ipsum voluptatem fugiat qui numquam libero quidem mollitia aliquam iure ullam nostrum esse voluptas laborum illum et vel commodi totam libero commodi aut minus hic nemo officiis qui molestias magnam ad rerum qui dolor nihil et eum voluptatem totam commodi architecto blanditiis cupiditate dolorem perspiciatis doloribus officiis voluptates cum est cupiditate dolores animi possimus sed id voluptatem culpa sit nihil molestiae delectus totam facere maiores quia consequatur est libero dolores sed voluptatem praesentium similique deserunt nemo dolorem ea minima perspiciatis maxime reprehenderit.', 970657, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(81, 'Kosan Thamrin', 'Gg. Zamrud No. 861, Padangpanjang 13780, Aceh', 'Tulang Bawang', 'Quam aut quibusdam est cupiditate eius aliquid distinctio quis quas maiores nulla quia aperiam quam sit et quia repellendus in tenetur nobis beatae placeat sint reiciendis impedit similique quo tempora expedita aliquam velit quam error et ad ipsa accusamus odio temporibus ut dolores architecto cupiditate voluptas qui cum sit incidunt ipsum maxime fugiat ea fuga inventore sequi aspernatur hic est aut ducimus autem atque quae accusantium quam maiores et est at ut veniam debitis qui quibusdam voluptas vero laborum voluptatem non aperiam quibusdam id est sunt velit eaque dignissimos omnis neque.', 'Consequatur quia fugiat at est in ullam excepturi aliquid ut molestiae at et quisquam ut delectus est aut nostrum recusandae aut aperiam voluptatem perspiciatis saepe est eum et id nostrum sed aut id voluptates laboriosam asperiores in est iure voluptatem ut aperiam perspiciatis et omnis ab adipisci laudantium non minima laboriosam omnis possimus magnam quisquam est delectus nulla iste est error dolor dolorem molestiae debitis omnis dolores sit a deleniti qui fugiat vel aut quisquam ratione rerum error maiores eius nesciunt odit tempora qui ab cupiditate deserunt porro reiciendis dolore sint quidem.', 789302, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(82, 'Kosan Zulaika', 'Ki. Ikan No. 71, Bontang 20132, Kaltim', 'Tulang Bawang Barat', 'Incidunt aut ut cumque enim nobis qui cupiditate officiis vero hic molestiae at et qui blanditiis occaecati placeat eum consequatur quis velit totam quo fugiat quod in in et et odio illum est tenetur dolor ipsam at nulla commodi minus voluptates rerum quisquam ea illo debitis id cumque omnis non qui soluta expedita beatae adipisci minus perferendis molestiae consequuntur excepturi mollitia neque vel corporis amet consequuntur unde esse quidem temporibus laborum id voluptatum quis neque fugit fugit non et quidem error.', 'Nemo error cupiditate perspiciatis consequatur mollitia ut ducimus et nihil et laborum natus voluptas doloribus soluta cumque ducimus non consequatur eum est sed aliquid impedit unde saepe assumenda vel optio deleniti voluptas dignissimos soluta illo qui odio alias consequatur vel cum maxime suscipit ratione nulla autem architecto nostrum nostrum debitis atque at dolor maiores dolore cupiditate excepturi consequatur nulla omnis id accusamus porro velit et culpa rem debitis iusto distinctio laboriosam autem tenetur quo et deleniti et facilis non non deleniti dolores qui voluptas asperiores voluptatem aliquam esse molestiae perferendis culpa maiores quod magni consectetur similique tempore pariatur in officia unde sequi eaque est quisquam et iusto velit molestiae enim fugiat sunt quis voluptas molestiae alias accusamus blanditiis enim sint deleniti voluptatem sequi ut facilis.', 833249, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(83, 'Kosan Putra', 'Jln. Kartini No. 230, Jayapura 81831, Sultra', 'Lampung Tengah', 'Quo possimus nemo soluta beatae perferendis et id aut fugit qui veniam inventore provident hic ea quisquam voluptatem eum impedit id quae laborum voluptatibus quia saepe nemo ratione vero numquam necessitatibus molestias sunt porro voluptas aut at enim atque dolor ducimus sint quia et esse consequatur voluptatem sapiente sequi consectetur accusamus vero consequatur cumque labore autem iste similique non iste qui aut deserunt vel est placeat perspiciatis incidunt sit facilis incidunt fuga perferendis et ullam quo ut distinctio aut quis minus id est fuga magni qui ut aut ut odit et dolor voluptas autem tempore reiciendis perspiciatis non exercitationem et cumque eos et similique sint quaerat nesciunt ut cupiditate qui aut consequuntur molestiae ducimus omnis est facere et dolores iusto rerum velit architecto tempora vel et quas in consequatur harum.', 'Dicta fugiat in id velit voluptatem adipisci tempore sed nihil ullam aut facere mollitia voluptatem sit ipsa eveniet qui eveniet molestias aut voluptas tempora veniam quidem nesciunt illum nesciunt et est eaque quam atque voluptate rerum velit ut blanditiis non fuga est quas libero fuga suscipit dignissimos omnis aut asperiores minus eos libero blanditiis sequi est aliquam consequuntur voluptatem atque assumenda perferendis eius qui similique minus vel aliquid blanditiis in et voluptatem animi animi ut ipsum ipsa suscipit nisi voluptates ea non rerum enim molestias qui beatae atque nihil ipsam est iusto quaerat reprehenderit laboriosam in eaque quo nam accusantium provident deleniti autem quidem aliquid placeat labore sint explicabo vitae sunt quasi temporibus pariatur maiores culpa libero ut cumque esse et sit impedit.', 826737, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(84, 'Kosan Winarno', 'Dk. Nanas No. 354, Pekanbaru 83194, NTB', 'Tulang Bawang', 'Et aliquid similique dignissimos voluptates qui tenetur ut porro est ducimus rerum non ducimus autem et non rerum qui est quae consequatur et quam quis sint architecto totam sunt ut porro ut quo provident enim ullam omnis omnis quaerat voluptas qui quis eius voluptatem quasi dolorem neque quasi placeat magni reprehenderit at rerum et quia soluta vel facilis doloribus atque veniam commodi omnis quia aperiam nesciunt magnam tempora odit quo quam voluptas velit sed quos sed quod est in amet quae culpa voluptas aut quasi libero nisi ipsam voluptatum est sint est repellendus exercitationem sunt.', 'Et voluptatem doloribus autem et ea enim in tenetur dolore error modi fugit voluptatibus impedit rerum atque dolore a laudantium voluptatem porro dignissimos autem unde vitae recusandae harum ab officia beatae facere architecto totam blanditiis aut veritatis natus eos maxime reiciendis perferendis voluptatum sit modi nisi impedit quam rerum quaerat voluptate temporibus totam dolor laborum expedita repudiandae consectetur sit omnis qui et quo voluptas dicta earum culpa aut corporis rem quaerat accusamus corporis tenetur ut soluta dolor laborum sint est sint eius sit est exercitationem ut ut debitis repudiandae ut et accusantium accusantium quia architecto non expedita inventore enim accusamus sunt hic atque natus occaecati voluptatem.', 940436, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(85, 'Kosan Sihotang', 'Ki. Salatiga No. 434, Batu 32121, Sulbar', 'Pesawaran', 'Soluta omnis totam tempora asperiores qui et consequatur minima architecto eum velit repellendus doloremque culpa nihil consequatur odit sit error quos explicabo aut unde consequatur itaque provident velit id velit quia temporibus aut fugit incidunt excepturi praesentium aut sed non ipsa assumenda eveniet inventore in magni autem facere sunt nisi magni numquam reprehenderit enim iusto et deserunt autem ad facilis dolore consequatur ea et in adipisci officiis sit et consectetur et et error ad et et ipsa voluptatem voluptatem laboriosam explicabo dolorum aut totam eos maxime omnis possimus ut necessitatibus repudiandae odio sit aliquid et velit at numquam aut in quia eius aliquid dolores non ut aut maxime eum voluptatum animi corporis quis itaque eveniet omnis consequuntur et est porro debitis provident ut quae qui porro quasi nisi error nihil consequatur maiores possimus ea aut dolor qui ut esse.', 'Qui maiores doloribus ullam quia in ut nam laudantium architecto deleniti suscipit facere error dolore est totam facilis et ea aut reprehenderit est vero aut ut commodi odio quis officiis adipisci officiis in aut et cum labore vitae consequatur laudantium sed officiis ipsa velit sit id nobis explicabo assumenda quia repellat officiis provident sed quod dolor iusto ab quae quas libero modi ipsa beatae quidem consequatur quae quo sit et doloremque cumque ut est consectetur suscipit aspernatur corporis enim quasi dolor voluptatem ut veritatis libero reprehenderit rem excepturi veritatis sunt voluptatibus assumenda et error ipsam dolor at.', 736942, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(86, 'Kosan Hastuti', 'Gg. Rajawali Barat No. 375, Sibolga 11471, Sulteng', 'Way Kanan', 'Incidunt esse officia odio numquam quaerat tempora odio iste doloribus illo laboriosam aspernatur omnis enim saepe architecto autem tempora rerum soluta ducimus cumque in quo aut sunt animi ut ipsa non voluptas dicta sint repudiandae deleniti est quia eveniet sit qui dolores maxime ipsa ut ullam nesciunt iusto laboriosam minima blanditiis quas quia nesciunt nihil reiciendis incidunt itaque mollitia qui cupiditate pariatur laudantium quo excepturi ea quas sint voluptatem omnis quia architecto hic quis nam dolor in tempora expedita eius cumque fugit quae voluptatibus.', 'Libero animi blanditiis sed rem ut alias vel tempore tempora earum qui vel iusto ut cumque et eos aut ut illo dolor eaque maiores et repellat sequi exercitationem sequi ea dignissimos placeat aut ducimus non sed sapiente nostrum velit beatae quaerat quae possimus iusto ea omnis est minima eos quam mollitia nemo quos in iste nam in perspiciatis est repudiandae natus in ipsa quo ex rerum sunt in voluptates quam aliquam veniam praesentium illo omnis quas corporis quae est reprehenderit reiciendis dolorem qui inventore eius in omnis porro veniam non iure ipsa et dolores fugiat est laborum qui voluptatum deleniti ut voluptas repudiandae dignissimos ipsa dicta qui eum quidem nihil consequatur sint rem delectus quos animi error iste eaque.', 639352, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(87, 'Kosan Nurdiyanti', 'Jln. Sampangan No. 960, Manado 28798, Malut', 'Lampung Utara', 'Repudiandae cumque id unde quia laboriosam cum vel voluptas hic ut reiciendis praesentium ipsa in neque aut doloremque error quibusdam culpa suscipit ut quas ut minus amet atque repellendus ea velit earum praesentium quasi harum ea harum animi fugiat omnis natus mollitia sunt quae consequuntur sequi qui asperiores enim cumque doloremque nobis omnis id consequatur deleniti provident et iusto fugiat et vel et.', 'Sed quaerat ipsam est ipsam necessitatibus vitae praesentium qui minima non deleniti libero aut ea velit non quis rerum veritatis laboriosam ipsa sed quis nesciunt occaecati magnam ipsum temporibus et expedita sint molestiae dolorem ut quos quas est a nostrum illo omnis qui deserunt et harum in ea dicta aliquid dolorem ad quo aliquam tempore dolore dolore consectetur expedita animi iusto nemo quis hic qui exercitationem odit accusamus totam veniam sint dolor rem rerum et ut sunt est incidunt optio facilis nemo recusandae sit porro fugit blanditiis magnam consequatur sit et quia aperiam consequatur aut quaerat numquam accusamus qui libero quaerat enim quasi error quam et unde nulla aut impedit quia autem facere aut libero non in nihil.', 937288, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(88, 'Kosan Adriansyah', 'Psr. Orang No. 189, Batam 67359, Jabar', 'Way Kanan', 'Nisi voluptate sed veniam quos voluptate earum nisi distinctio natus voluptates earum deleniti earum totam voluptatibus sint architecto atque eos dolor labore doloremque architecto veniam dolores voluptatem alias nihil incidunt nam voluptatibus ad maxime natus libero minus laboriosam atque rem aspernatur aut quisquam molestias excepturi exercitationem autem quisquam unde ipsum facilis sed illo dicta maiores velit optio sunt expedita minus quis ex sint mollitia est voluptatem sed iure eaque et delectus mollitia rem et et dolores dolore illum officiis quia similique sit ducimus harum molestiae voluptatem eum nisi error dignissimos adipisci in sed ipsum quae eos eius odit neque nam omnis mollitia in accusamus rem fugiat occaecati exercitationem dolores cumque magnam ipsa voluptas neque aliquid quidem repellat quia harum alias voluptatum sit aut accusamus occaecati.', 'Non ut ipsam facilis consequatur quas similique quidem incidunt soluta quia aut explicabo voluptatum est sed illo voluptate perferendis quod qui dolor et at aperiam architecto nam perspiciatis eveniet quisquam quia aut et velit nihil laboriosam pariatur architecto sequi officia consequatur nostrum esse enim omnis illum perferendis autem et blanditiis velit a quidem cumque illo consequatur dolor vel aut sunt expedita sit aut qui voluptatum reiciendis ut quisquam ducimus quis cupiditate illum sed enim placeat nihil atque quidem adipisci cum ullam quisquam ullam sed ut repellendus et et vero quas tempore distinctio est ratione numquam numquam voluptatem sed et et qui eos et qui nesciunt quisquam consequatur eum commodi delectus magnam magni quae sapiente natus amet et culpa deleniti quasi officiis iure.', 602782, 'Putri', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(89, 'Kosan Napitupulu', 'Jln. Yap Tjwan Bing No. 898, Medan 68246, Jambi', 'Lampung Utara', 'Ut animi a consequatur voluptatem quo tempore saepe vel consequatur nulla rerum possimus aspernatur amet qui et accusantium id quae non sed voluptates rerum suscipit alias aperiam quia ab dolores ea ad exercitationem quia sunt aut porro et vitae veniam velit officiis ut sed recusandae asperiores autem rerum vitae rem dolorem et voluptas sed suscipit beatae in quis autem velit dignissimos.', 'Et voluptas mollitia aut assumenda doloremque iste repellat expedita et quas eum laboriosam voluptatibus voluptas eaque quia eos et rem et voluptates voluptatem quasi laborum et sint ad perspiciatis optio eius molestiae aut et dolore ipsam temporibus quis sint corrupti quia et tempore molestias recusandae eos aut veniam quo nemo laborum dicta aut et consequatur omnis sit quibusdam rerum non eum molestiae est vel rerum sit ut sed nisi praesentium omnis nesciunt molestiae magnam distinctio quidem minima nesciunt et unde.', 510327, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(90, 'Kosan Maryati', 'Jr. Ters. Jakarta No. 771, Sorong 53801, Babel', 'Lampung Barat', 'Optio fuga excepturi nisi commodi tempora repudiandae non aperiam sint voluptatem expedita fugiat perspiciatis dolorem unde voluptas modi fuga alias corporis consequatur perspiciatis assumenda enim qui quas nam aperiam inventore suscipit consectetur excepturi officiis iusto officiis repellendus deserunt sit ex voluptatem ipsa eum eius incidunt omnis nostrum unde vel non labore rerum nesciunt culpa sapiente occaecati vel aliquam est exercitationem delectus vitae nihil quasi autem itaque occaecati et corrupti et dicta hic nobis quam suscipit quidem ut ut doloribus et ad ratione facere in ut totam voluptatum architecto qui qui dolores est error adipisci id dignissimos maxime quam nemo enim fugiat eum quis optio similique inventore vel et natus accusantium labore earum optio magni dolorum quia explicabo officiis aut id qui recusandae qui quae sint libero omnis quia a alias.', 'Et dolore alias odit eius eum non iusto autem et est ea dolor vel et aut praesentium perspiciatis quis nisi voluptates rerum quo est similique quidem est molestiae et earum sapiente mollitia doloribus et nihil consequatur repudiandae architecto id sed sint officiis quaerat et dolor asperiores aliquam in adipisci qui id atque sequi molestias ut rem sed animi ex quis doloremque quo fugit doloremque est in molestias id qui aperiam totam voluptas sit nulla in adipisci temporibus quaerat incidunt non omnis distinctio omnis et vitae praesentium non soluta ad est labore qui recusandae sed veritatis sunt fugiat quia eveniet temporibus optio nulla ea similique quas iusto.', 516708, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
(91, 'Kosan Nugroho', 'Psr. Pasirkoja No. 450, Singkawang 70794, Sulteng', 'Lampung Utara', 'Distinctio voluptas voluptatem occaecati nihil doloremque qui voluptas et nostrum provident excepturi eum voluptatem praesentium nihil dolor autem sunt nulla quia voluptatem rerum laboriosam et qui tenetur dolor aut neque ipsam occaecati incidunt et minima at et dolores natus enim adipisci tenetur aut facilis recusandae doloremque eum optio aspernatur qui quisquam qui enim voluptas et consequatur quod omnis ratione et eos quibusdam quis aperiam modi eveniet quis non qui aut nobis magni omnis sunt et eius ut deserunt voluptatem rerum quo repellendus architecto distinctio et cumque neque est esse ea totam quia laborum ut quam possimus distinctio cum distinctio quasi officia expedita non perspiciatis quaerat omnis maxime quo dolores nihil sed et aliquam est nisi debitis optio quis aut beatae dolor assumenda itaque ut id aut saepe.', 'Et molestiae dolores sequi recusandae debitis facilis ipsa voluptatem iste qui id molestias libero quam consequuntur consectetur enim necessitatibus inventore in nemo saepe non consequatur consequuntur ut deserunt laudantium nemo et tempora iure consequatur veniam velit id excepturi laboriosam tenetur nostrum et incidunt odio fuga officiis et quos neque commodi sapiente et laborum sed ullam qui alias id ad eum aperiam et sunt quae cupiditate ut dolorem non cumque ratione est voluptas et eum corrupti iste excepturi quisquam consequuntur nisi sit laborum placeat saepe aperiam ipsum laboriosam perspiciatis vel tempore modi corporis eligendi temporibus nulla sint facilis vel iure eius.', 911000, 'Putra', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
