(99, 'Kosan Pertiwi', 'Ds. Banda No. 539, Tanjung Pinang 15674, Sultra', 'Lampung Utara', 'Rerum dolorem amet enim perspiciatis laborum maiores quisquam molestias sunt est vitae magni voluptas impedit amet corporis autem voluptas ab possimus et quibusdam et velit deleniti iusto dolores qui ducimus temporibus voluptas consequatur eius distinctio aut amet doloremque ipsam molestiae porro at aut aut quas accusamus itaque aut aliquid qui omnis voluptatibus adipisci reiciendis sint in dolores quas aut minus sequi quo aspernatur iste cupiditate facere voluptas aut qui tempore iusto ut voluptatem quia numquam sit corporis aspernatur repudiandae consequatur blanditiis ut praesentium et at quidem maiores autem velit voluptatibus modi esse id reprehenderit saepe ut harum vitae nihil et dolore cumque quis quia voluptas nulla aut quam quod aut animi quia dolor consequatur nihil odit at fugit nihil sapiente.', 'Nostrum eligendi velit dolorum qui quos atque repellendus quasi nihil deserunt et cupiditate iste sunt veritatis officia eveniet tempora sit sit libero voluptas eum laboriosam rerum aut ipsa deserunt dicta est molestiae reprehenderit sunt suscipit saepe adipisci est veritatis assumenda aspernatur id praesentium aperiam nisi itaque quis amet eaque eum illum velit perspiciatis eum esse ut dolor sunt iste magni fugit non libero inventore ut culpa sed sed recusandae officiis placeat ut et id ab incidunt incidunt quibusdam molestiae tenetur placeat doloremque dolore deleniti quia in ipsum eos sit voluptatibus perferendis quibusdam autem esse beatae omnis laboriosam saepe ducimus vero maiores aut quaerat optio possimus ipsa non blanditiis sequi facere aspernatur iste hic quidem ullam in.', 625762, 'Campur', 1, '2022-10-30 22:31:58', '2022-10-30 22:31:58', '2022-10-30 22:31:58'),
